import React from "react";
import Preloader from "../../commonComponents/preloader";

function Home() {
  return (
    <div>
        <h1>Home</h1>
        <p>Welcome to the home page.</p>
        <Preloader wordsList={["Home"]}/>
    </div>
  );
}

export default Home;
